import React from "react";
import { useNavigate } from "react-router-dom";

function Header({ nupirkta, logedUser, setLogedUser }) {
  const nav = useNavigate();

  function toUpload() {
    nav("/uploadProduct");
  }
  function toAllProd() {
    nav("/allProducts");
  }
  function toProfile() {
    nav("/profile");
  }
  function toNupirkta() {
    nav("/myProducts");
  }
  function logOut() {
    setLogedUser(null);
    nav("/login");
  }

  return (
    <div className="footer">
      {logedUser
        ? `<h3 onClick={toProfile}>Profile</h3>
      <h3>Money: {logedUser.money}$</h3>
      <h3 onClick={toAllProd}>All products</h3>
      <h3 onClick={toUpload}>Upload Product</h3>
      <h3 onClick={toNupirkta}>My products:({nupirkta.length})</h3>
      <h3 onClick={logOut}>LogOut</h3>`
        : `<h3 onClick={logOut}>LogIn</h3>
      <h3 onClick={logOut}>Register</h3>`}
    </div>
  );
}

export default Header;
